export default Object.freeze({
  updateGuidePoints: (items) => {
    let points = [];

    for(let i=0; i<items.length; i++) {
      let item = items[i];
      points.push(item.bounds.center);
      points.push(item.bounds.left);
      points.push(item.bounds.right);
      points.push(item.bounds.top);
      points.push(item.bounds.bottom);
    }

    
  },
